  ~SYM[11] <= true when ~SYM[10] = '1' else false;
  ~RESULT <= (~SYM[1],~SYM[2],~SYM[3],~SYM[4],~SYM[5],~SYM[6],~SYM[7],~SYM[8],~SYM[9],~SYM[11]);
end block;
